※必ずご確認ください！<br>
◆バッテリーをご注文の際、配達地が離島の場合（沖縄県本島は除く）別途1000円を頂戴しての発送となりますの。<br>
あらかじめご了承ください。（送料無料商品・送料別商品すべて）<br><br>
◆ゆうメール（メール便）送料無料の商品に送料別の商品を購入した場合
別途送料が発生します。<br>
ご購入時は送料が表示されませんが当店受注後に送料を追加いたしますのでご了承ください。<br><br>

◆ゆうメールでの発送の際は、『コンビニ受取は不可』となりますのでご了承ください。
<Br>また、コンビニ受取をご指定の場合は運送便　『+650～1080円』　での出荷をさせて頂きますのでご了承ください。<br><br>

